import HomeImage from "../images/home.jpg";

const Home = () => {
  return (
    <div className="home-page">
      <div className="image-container">
        <img src={HomeImage} alt="Me in Maine" />
      </div>
      <div className="text-container">
        <h1>VIVIAN LI</h1>
        {/* do these as different colored lines */}
        <p>Ph.D. student at University of Colorado Boulder</p>
        <p>Department of Computer Science</p>
        <p>Co-advised in the Department of Ecology & Evolutionary Biology</p>
      </div>
    </div>
  );
};

export default Home;
